// Group and count landing page types by brand
const grouped = {};

for (const item of items) {
  const brand = item.json.output.brand;
  const type = item.json.output["page-type"];

  if (!grouped[brand]) {
    grouped[brand] = {
      total: 0,
      distribution: {},
    };
  }

  grouped[brand].total += 1;
  grouped[brand].distribution[type] = (grouped[brand].distribution[type] || 0) + 1;
}

// Convert to output format n8n can handle
const results = [];

for (const brand in grouped) {
  const total = grouped[brand].total;
  const dist = grouped[brand].distribution;

  const percentages = {};
  for (const type in dist) {
    percentages[type] = ((dist[type] / total) * 100).toFixed(2) + "%";
  }

  results.push({
    json: {
      brand,
      total,
      distribution: dist,
      percentages,
    }
  });
}

return results;

const MAX_LENGTH = 128000; // characters, not tokens — tweak as needed
const html = $input.first().json.data || "";

return [
  {
    json: {
      trimmedContent: html.slice(0, MAX_LENGTH)
    }
  }
];

let raw = $input.first().json.output;
raw = raw.trim();
const parsed = JSON.parse(raw);
return [
  {
    json: {
      brand: parsed.brand || null,
      url: parsed.url || null,
      "page-type": parsed["page type"] || null
    }
  }
];
